import Expense from "./components/Expense";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: "94.12",
      date: new Date(2021, 7, 14),
    },
    {
      id: "e2",
      title: "New Tv",
      amount: "799.49",
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: "294.67",
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: "450",
      date: new Date(2021, 5, 1),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expense items ={expenses}/>
    </div>
  );
}

export default App;
